postcontent:
I am selling this beautiful, Belgian-made Browning Hi-Power in 9mm, manufactured in 1986. This classic single action semi-automatic pistol performs flawlessly and features fully adjustable target sights (windage + elevation), a crisp trigger and a deep blue finish at 99%. Together with the gun, the buyer will receive:

- One pair of custom made, Esmeralda rosewood picazo grips (mounted);
- One pair of Browning factory grips w/medallion;
- One pair of Pachmayer girps;
- Three magazines: one 13-round Browning factory magazine and two brand new 15-round Mec-Gar magazines. 

Please write with any questions or to request additional photos. Buyer must have pistol purchase permit or CCW + valid NC driver's license. A bill of sale will be provided. All relevant laws will be observed.
